			Thêm khách hàng
			<div className="form-input-container">
				<IconInput icon = "Tên"></IconInput>
				<IconInput icon = "Tên"></IconInput>
				<IconInput icon = "Tên"></IconInput>
				<IconInput icon = "Tên"></IconInput>
			</div>
			<div className="form-button-container">
				<button className="from-button">Add</button>
				<button className="from-button">Close</button>
			</div>
		</div>
	);
};

export default AddCustomerForm;
